import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import character from './character';
function App(){
    return <div>
    <Header />
    <div class="container bootstrap snippets bootdeys">
    <div class="row">
    {character.map((inf) => (
          <Card
            title={inf.charac}
            n={inf.name}
            des={inf.meaning}
          />
        ))}
    </div>
    </div>
    <Footer />
    </div>;
}
export default App;
